// ThemeContext.ts
import React from 'react';

export const themes = {
  light: {
    foreground: '#4d4d4d', // Neutral dark gray
    background: '#f0ebe4', // Soft cream
  },
  dark: {
    foreground: '#f0ebe4', // Soft cream (text color for dark mode)
    background: '#4d4d4d', // Neutral dark gray (background for dark mode)
  },
  accent: {
    foreground: '#a69cac', // Muted lavender
    background: '#c3b8c6', // Soft lilac
  },
};

export const ThemeContext = React.createContext(themes.light);
